import React from "react";

import SiteButton from "../UI/SiteButton";
import Header from "../Components/Header";
import Footer from "../Components/Footer";

import classes from "./Compose.module.css";
import classes2 from "./Nespresso.module.css";

const Nespresso = () => {
  return (
    <div className={classes.wrap}>
      <Header bgColor=" " titleColor="#ffffff" />

      <div
        className={classes2.subPageBanner}
        style={{ background: "url(images/sub_nespresso_banner.png)" }}
      >
        <SiteButton
          className={classes.composeBtn}
          btnColor="#d3391a"
          textColor="#ffffff"
          top="775px"
          left="370px"
          link="nespresso/index.html"
        />
      </div>

      <SiteButton
        className={classes.composeBtn}
        btnColor="#d3391a"
        textColor="#ffffff"
        width="452px"
        top="12100px"
        left="50%"
        link="nespresso/index.html"
        transX="-50%"
      />

      <Footer footerTop="12267px" />
      {/* <img src="images/nespresso.png" alt="네스프레소" /> */}
    </div>
  );
};

export default Nespresso;
